#include <stdio.h>

int q1(char gene[]){
  int count = 0;
  while(gene[count] != 0){
    count++;
  }
  printf("%d\n",count);
  return count;
}

void q2(char gene[]){
  printf("%c\n",gene[99]);
}

void q3(char gene[],int count){
  printf("%c\n",gene[count-100]);
}

void q4(char gene[],int count){
  int a=0,t=0,g=0,c=0;
  for(int i = 0;i<count;i++){
    if(gene[i]=='A'){
      a++;
    }
    else if(gene[i]=='T'){
      t++;
    }
    else if(gene[i]=='G'){
      g++;
    }
    else if(gene[i]=='C'){
      c++;
    }
  }

  printf("%f\n",((double)a/count)*100.0);
  printf("%f\n",((double)t/count)*100.0);
  printf("%f\n",((double)g/count)*100.0);
  printf("%f\n",((double)c/count)*100.0);
}
int main(void)
{
  char gene[] = "";



  int count = q1(gene);
  q2(gene);
  q3(gene,count);
  q4(gene,count);
	   
  return 0;
}
